script: |
  super -f text -I q10544.spq | sort > q10544.out

inputs:
  - name: q10544.spq
    data: |
      SELECT CAST ( - + 18 AS REAL ) * + CAST ( + col2 AS INTEGER ) + + - col2 FROM tab0 (FORMAT parquet) WHERE NULL NOT BETWEEN NULL AND - + col2 * - col2 / col2;
  - name: tab0

outputs:
  - name: q10544.out
    data: |
